import React from 'react';

export default function Book(props){
    return(
        <div className="book_wrapper" style='background:{${}}'>
            <span className="book_rating"></span>
            <div>
                <cite className="book_title"></cite>
                <p className="book_author"></p>
                <p className="book_publisher"></p>
            </div>
        </div>
    )
}
